import React from 'react';
import { observer } from 'mobx-react-lite';
import productStore from '../Stores/ProductStore';
import { toJS } from 'mobx';

const ProductDetails = () => {

  console.log(toJS (productStore.selectedProduct));
  return (
    <div className="card">
      <div className="container">
        {productStore.selectedProduct != null?  productStore.selectedProduct.title : "Ürün"} 
        <br/>
        {productStore.selectedProduct != null?  productStore.selectedProduct.description : "Bulunamadı"}
      </div>
    </div>
  );
};

export default observer(ProductDetails);
